import React from "react";
import { Line } from "react-chartjs-2";
import {Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,

} from "chart.js";

ChartJS.register(
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
);


function LineChart() {
  const data = {
    labels: ["January", "February", "March", "April", "May", "June"],
    datasets: [
      {
        label: 'Ritik',
        data: [2, 4, 5, 6, 1, 9],
        fill: true,
      },
      {
        label: 'Nikhil',
        data: [8, 3, 1, 6, 2, 9],
        fill: true,
      }
    ]
  };

  const options = {
    scales: {
      y: {
        beginAtZero: false,
      },
      x: {
        beginAtZero: false,
      }
    },
    plugins: {
      legend: {
        display: true,
        position: 'top',
      },
      tooltip: {
        enabled: true,
      },
    }
  };

  return <Line data={data} options={options} />;
}

export default LineChart;
